package cs3500.imageprocessor.model.effects.singlelayer;import java.util.function.Function;import cs3500.imageprocessor.model.image.Pixel;import cs3500.imageprocessor.model.image.PixelImpl;/** * This class contains methods to give no filter to the layer. */public class Normal implements Function<Pixel, Pixel>, SingleLayerFilter {  private final String name = "Normal";  @Override  public Pixel apply(Pixel pixel) {    return new PixelImpl(pixel.getRed(), pixel.getGreen(),            pixel.getBlue());  }  @Override  public String getName() {    return this.name;  }}